xt 1.1\",\"params\":{\"text\":\"<p>Since chlorine is neutral, the number of electrons in its electron cloud is also equal to 17.</p>\\n\"},\"subContentId\":\"26cb8ab9-039c-42e5-9f33-f6d4184a59a2\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":13.630165413533835,\"y\":68.45830758994344,\"width\":81.203007518797,\"height\":7.2403284064445605,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Chlorine has 17 protons. Its mass number A=35, so it has N = A - Z = 35 - 17 = 18 neutrons.</p>\\n\"},\"subContentId\":\"4b35d29a-0a4d-47bd-bbeb-b65324c61b86\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.2380989010989,\"y\":87.65010845987,\"width\":97.608058681319,\"height\":11.764280694143,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>The mass of an atom is concentrated in its nucleus since the mass of electrons is negligible (inconsiderable).<br />\\nThe volume of an atom is mostly constituted of empty space.</p>\\n\"},\"subContentId\":\"516e966f-bca3-442d-98e6-848cffc1c8ed\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":2.4783147459727,\"y\":7.3349633251834,\"width\":93.977695167286,\"height\":16.723716381418,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Atoms of the same element are represented by the same symbol which is generally the first letter of their name in <strong>uppercase</strong>. For atoms starting with the same letter, a second letter in <strong>lowercase </strong>is added.<br />\\nExamples are <strong>C</strong> for carbon and <strong>Cl</strong> for chlorine, <strong>Ca</strong> for calcium, <strong>Cu</strong> for copper.</p>\\n\"},\"subContentId\":\"a456a815-8889-4e14-91c6-45ac2615ec82\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.2391573729864,\"y\":80.684596577017,\"width\":74.151177199504,\"height\":6.9437652811736,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>The atomic number is characteristic of the chemical nature of the element.</p>\\n\"},\"subContentId\":\"438ffd09-89c0-41f8-8685-f31d13d43816\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":17.348203221809,\"y\":46.454767726161,\"width\":59.529120198265,\"height\":48.264058679707,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4RH9RXhpZgAATU0AKgAAAAgABwESAAMAAAABAAEAAAEaAAUAAAABAAAAYgEbAAUAAAABAAAAagEoAAMAAAABAAIAAAExAAIAAAAeAAAAcgEyAAIAAAAUAAAAkIdpAAQAAAABAAAApAAAANAACvyAAAAnEAAK/IAAACcQQWRvYmUgUGhvdG9zaG9wIENTNiAoV2luZG93cykAMjAxODowODoxMiAxNzo0OTo1NAAAA6ABAAMAAAABAAEAAKACAAQAAAABAAACYaADAAQAAAABAAAA+gAAAAAAAAAGAQMAAwAAAAEABgAAARoABQAAAAEAAAEeARsABQAAAAEAAAEmASgAAwAAAAEAAg :23.76209288714453,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>There are 118 elements in nature but only very few exist as isolated atoms. Atoms come together in different numbers and dispositions to form an extremely high variety of molecules. Lots of molecules naturally exist in nature, such as water and carbon dioxide. They are called natural molecules. Others are manufactured by man, like molecules found in medicines and plastic material. They are called synthetic molecules.</p>\\n\"},\"subContentId\":\"5c878678-1e65-48b0-8019-c25cc96bbea6\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}]},{\"elements\":[{\"x\":1.2391573729864,\"y\":4.8899755501222,\"width\":96.703841387856,\"height\":11.833740831296,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>There are models where sticks are used to show the bonds between different atoms within a molecule, and other models where bonds are not represented. Here are some examples:</p>\\n\"},\"subContentId\":\"32e23a01-f2da-4c96-90cd-996881d7f355\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":2.4783147459727,\"y\":19.559902200489,\"width\":18.389095415118,\"height\":30.660146699267,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGgoAAAANSUhEUgAAAMAAAACjCAYAAADcvBHzAAAgAElEQVR4nO29eZQcx3kn+Is8qqqrTzQAUhBBXCRIECRISh4fbEpEQbLkkUjbK0LiaYmUZM/sH97xeIA5bFPq6ufnt2+fAa/k3Z3Z2WdbPCQShAh75UMUTUld4FEYed5IBk an <strong>anion</strong>. Anions have more electrons than their corresponding atoms.</p>\\n\\n<p>During ionization only electrons are gained or lost. The nucleus is not involved in the process. So an ion has the same number of protons and neutrons as its corresponding atom.</p>\\n\"},\"subContentId\":\"6a65f7bc-df7e-403b-8173-28f6b0fab013\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":1.2391573729864,\"y\":2.4449877750611,\"width\":20.86741016109,\"height\":5.4767726161369,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>Classification of ions</strong></p>\\n\"},\"subContentId\":\"34b45bef-52d7-479d-b0d7-102ef78bd0fb\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.0893246187363834,\"y\":30.12462989740412,\"width\":81.74629629629631,\"height\":53.86864800661021,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"alt\":\"Classification of ions\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4Q/SRXhpZgAATU0AKgAAAAgABwESAAMAAAABAAEAAAEaAAUAAAABAAAAYgEbAAUAAAABAAAAagEoAAMAAAABAAIAAAExAAIAAAAeAAAAcgEyAAIAAAAUAAAAkIdpAAQAAAABAAAApAAAANAACvyAAAAnEAAK/IAAACcQQWRvYmUgUGhvdG9zaG9wIENTNiAoV2luZG93cykAMjAxODowODoyNyAwOTowOTo0OAAAA6ABAAMAAAABAAEAAKACAAQAAAABAAADWKADAAQAAAABAAABHQAAAAAAAAAGAQMAAwAAAAEABgAAARoABQAAAAEAAAEeARsABQAAAAEAAAEmASgAAwAAAAEAAgAAAgEABAAAAAEAAAEuAgIABAAAAAEAAA6cAAAAAAAAAEgAAAABAAAASAAAAAH/2P/tAAxBZG9iZV9DTQAB/+4ADkFkb2JlAGSAAAAAAf/bAIQADAgICAkI ,\"solution\":\"\"},{\"x\":1.0893246187363834,\"y\":86.07037113544034,\"width\":34.498141263941,\"height\":9.3887530562347,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Monoatomic cations come from metals.<br />\\nAnions come from non-metals.</p>\\n\"},\"subContentId\":\"a99d2001-9027-4288-9f23-e4645810723d\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.2391573729864,\"y\":17.114914425428,\"width\":94.225526641884,\"height\":11.833740831296,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>A monoatomic ion is made up of a single atom that lost or gained 1 or more electrons.<br />\\nA polyatomic ion is a charged molecule acting as a unit.</p>\\n\"},\"subContentId\":\"1e899252-155c-4f3d-a922-5fa9e488e5ca\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"slideBackgroundSelector\":{},\"elements\":[{\"x\":1.2391573729864,\"y\":2.4449877750611,\"width\":39.950433705081,\"height\":5.4767726161369,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>Basic structure of Pure Matter</strong></p>\\n\"},\"subContentId\":\"e9dd42d6-c297-4cc8-b75a-6269e4cc4bbe\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.2391573729864,\"y\":12.224938875306,\"width\":51.84634448575,\"height\":5.4767726161369,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Pure matter is composed of either elements or compounds.</p>\\n\"},\"subContentId\":\"65dc4c75-cc11-4647-a533-cbeb12cc80ca\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.2391573729864,\"y\":7.3349633251834,\"width\":69.938042131351,\"height\":5.4767726161369,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Atoms, molecules and ions are the building blocks of elements and compounds.</p>\\n\"},\"subContentId\":\"23c9b2f2-15c4-45ee-9fd4-4103ee3bed97\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.0989010989011,\"y\":17.324663774403,\"width\":97.717948791209,\"height\":82.263196095445,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:0.875em\\\"><strong>1- Monoatomic elements</strong>:<br />\\n<span>Monoatomic elements are elements that exist independently as atoms. All metals are monoatomic elements. Fe, Al, Cu, Au. Metals can react with other elements to form coumpounds.<br />\\nNoble gases such as helium, neon, argon exist as monatomic gases and do not react with other elements.</span></span></p>\\n\\n<p><span style=\\\"font-size:0.875em\\\"><strong><span>2- Molecular elements: </span></strong><br />\\n<span>Molecular elements are elements, mostly diatomic non metals, that exist as molecules, that is, 2 or more atoms of the same type bound together. Examples are hydrogen gas, oxygen gas, chlorine gas, bromine and iodine. </span></span></p>\\n\\n<p><span style=\\\"font-size:0.875em\\\"><strong><span>3- Molecular compounds:</span></strong><br />\\n<span>A molecular compound is a compound that consists of molecules. They are made of non-metal elements bonded together. Examples are water, methane, ethylene, ammonia, hydrogen sulfide, carbon dioxide...Molecular compounds do not conduct electricity. They are not electrolytes.</span></span></p>\\n\\n<p><span style=\\\"font-size:0.875em\\\"><strong><span>4- Ionic compounds:</span></strong><br />\\n<span>An ionic compound consists of a combination of ions arranged in a crystal structure. Ionic compounds consist of a non metal ion chemically bonded to a metal ion via strong electrostatic forces called ionic bonding. Examples are sodium chloride, potassium hydroxide, </span> potassium bromide, magnesium oxide ... Ionic compounds are electrolytes.</span></p>\\n\\n<p> </p>\\n\"},\"subContentId\":\"6d2f6871-ad87-472d-9bb5-08562d0740d4\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}]},{\"elements\":[{\"x\":1.0893246187363834,\"y\":2.1517592783860082,\"width\":8.4758364312268,\"height\":5.4767726161369,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:1.25em\\\"><strong>Quarks</strong></span></p>\\n\"},\"subContentId\":\"dd917795-2232-444f-b5fe-3e0692f45a10\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":52.044609665428,\"y\"
